    false,nt"url": null,nt"notes": "Proposal by the State of Wyoming, Wyoming
    Game and Fish Department, to vaccinate elk on the National Elk Refuge.  The proposal
    provides a protocol for vaccinating elk on the National Elk Refuge with strain 19
    (S19) a modified live strain of Brucella abortus, via biobullet as a means to reduce
    brucellosis-induced abortions.The proposal is submitted to the U.S. Fish and Wildlife
    Service Director for a compatibility review pursuant to the Settlement Agreement
    entered June 21, 2002 in the case of Wyoming vs. United States.",nt"license_title":
